# Sukhaya, Kabansky District, Republic of Buryatia

}}
Sukhaya () is a rural locality (a selo) in Kabansky District, Republic of Buryatia, Russia. The population was 550 as of 2010. There are 32 streets.
Geography
Sukhaya is located 95&nbsp;km northeast of Kabansk (the district's administrative centre) by road. Zarechye is the nearest rural locality.
